import React from 'react'
import { Route } from 'react-router-dom'

export default function LayoutPrimary({component: Component, ...rest}) {

    return (
       <Route {...rest}>
            <h>Header</h>
                <Component />
            <h>Footer</h>
       </Route>
    )
}
